import React, { Component } from 'react';
import '../../assets/css/ControlCenter/Nav.scss';
import NavBtn from "./NavBtn";

class Tabs extends Component {

    render() {
        return(
            <nav className="nav">
                <NavBtn btnName="Style"/>
                <NavBtn btnName="Export"/>
            </nav>
        )
    }
}

export default Tabs;
